import React from 'react';
import { Link } from 'react-router-dom';
import { Container } from 'react-bootstrap';
import Cabecalho from '../componentes/cabecalho';
//import CarouselBStrap from '../componentes/BScarousel';
import Carrocell from '../componentes/BScarrocell';
//import Reservaitem from '../componentes/BSmodal';

function Home() {
  return (
    
    <Container>


      <Cabecalho/>

      <table className='striped bordered hover'>
                      <div className="bg-dark text-white">
                        <thead>
                            <tr>
                                <th><Link to="/clientes">
                                    Clientes
                                  </Link></th>
                                <th><Link to="/funcionarios">
                                    Funcionarios
                                  </Link></th>
                                <th><Link to="/salas">
                                    Salas
                                  </Link></th>
                            </tr>
                        </thead>
                      </div>
      </table>

      <Carrocell/>

    </Container>

      )
      };

export default Home;
